 max height in px'=>'Obraz wejściowy maks. wysokość w px','Ratio restriction'=>'Ograniczenie współczynnika','x ratio'=>'stosunek x','Leave 0 to ignore. <strong>NOTE:</strong> if any of the two settings are left 0, the ratio restriction will be ignored.'=>'Pozostaw 0, aby zignorować. <strong>UWAGA:</strong> jeśli którekolwiek z dwóch ustawień pozostanie 0, ograniczenie stosunku zostanie zignorowane.','y ratio'=>'stosunek y','Leave 0 for ignore. <strong>NOTE:</strong> if any of the two settings are left 0, the ratio restriction will be ignored.'=>'Pozostaw 0, aby zignorować. <strong>UWAGA:</strong> jeśli którekolwiek z dwóch ustawień pozostanie 0, ograniczenie stosunku zostanie zignorowane.','DPI restriction'=>'Ograniczenie DPI','Input image min DPI'=>'Obraz wejściowy min DPI','Leave 0 for no limits. <strong>NOTE:</strong> DPI are read from EXIF so If an image has no valid EXIF data check will fail and the upload will not be performed.'=>'Pozostaw 0 bez ograniczeń. <strong>UWAGA:</strong> DPI są odczytywane z EXIF, więc jeśli obraz nie ma prawidłowego sprawdzenia danych EXIF, nie powiedzie się i przesłanie nie zostanie wykonane.','Input image max DPI'=>'Obraz wejściowy max DPI','Audio/Video length restriction'=>'Ograniczenie długości audio/wideo','The following options will have effects only for mp3/mp4/wav/webm/m4v/flac media files'=>'Poniższe opcje będą miały efekty tylko dla plików multimedialnych mp3/mp4/wav/webm/m4v/flac','Min length (seconds)'=>'Minimalna długość (sekundy)','Max length (seconds)'=>'Maksymalna długość (sekundy)','Order sub total percentage discount'=>'Łączna zniżka % przy finalizacji zamówienia','If at least one upload has been performed, a percentage discount will be applied to the order sub total.'=>'Jeśli wykonano co najmniej jedno przesłanie, do sumy zamówienia zostanie zastosowana procentowa zniżka.','Percentage'=>'Procent','This is the percentage discount applied to sub total.'=>'Jest to procentowy rabat zastosowany do sumy częściowej.','Discount description to show on cart'=>'Opis rabatowy do pokazania na koszyku','If left black will be used as description the upload field name. Use the <strong>%field_title</strong> placeholder to print the upload field title inside the discount description.'=>'Jeśli pozostanie czarny, zostanie użyty jako opis nazwy pola przesyłania. Użyj symbolu zastępczego <strong>%field_title</strong>, aby wydrukować tytuł pola przesyłania w opisie rabatu.','Discount for %field_title'=>'Zniżka na %field_title','Apply only once'=>'Zastosuj tylko raz','Enable this option if you do not want to apply the order sub total discount if another upload field already has.'=>'Włącz tę opcję, jeśli nie chcesz stosować rabatu sumy zamówienia, jeśli ma już inne pole przesyłania.','For each uploaded file the plugin will compute additional costs according the following options. The extra costs will be added to cart as fee.'=>'Dla każdego przesłanego pliku wtyczka obliczy dodatkowe koszty zgodnie z następującymi opcjami. Dodatkowe koszty zostaną dodane do koszyka jako opłata.','Overcharge type'=>'Rodzaj przeciążenia','<strong>NOTE:</strong> <strong>Percentage</strong> option will work with Variations/Variable products, only if: <ol><li><strong>Display the upload field for every product variation</strong> option has been enabled</li></ol>'=>'<strong>UWAGA:</strong> <strong>Opcja procentowa</strong> będzie działać z Wariacjami / Zmiennymi produktami, tylko jeśli: <ol><li><strong>Wyświetl pole przesyłania dla każdej odmiany produktu</strong> opcja została włączona </li></ol>','Fixed value'=>'Naprawiono wartość','Percentage of item price'=>'Procent ceny przedmiotu','Value'=>'Wartość','This will be the percentage or the fixed value added/subtracted to the original item price. Using <strong>negative</strong> values, the fixed/percentage value will be subtracted to the cart (applying then a <strong>discount</strong>).'=>'Będzie to procent lub stała wartość dodana / odjęta od pierwotnej ceny produktu. Przy użyciu <strong>ujemnych wartości</strong> wartość stała / procentowa zostanie odjęta do koszyka (stosując wówczas <strong>zniżkę</strong>).','Fee/Discount description to show on cart'=>'Opłata / opis rabatu do wyświetlenia na koszyku','If left black will be used as description the upload field name. Use the <strong>%prod_name</strong> placeholder to print the product name and the <strong>%field_title</strong> placeholder to print the upload field title inside the fee description.'=>'Jeśli pozostanie czarny, zostanie użyty jako opis nazwy pola przesyłania. Użyj symbolu zastępczego <strong>%prod_name</strong>, aby wydrukować nazwę produktu i symbol zastępczy <strong>%field_title</strong>, aby wydrukować tytuł pola przesyłania w opisie opłaty.','Extra costs %field_title for %prod_name'=>'Dodatkowe koszty %field_title dla %prod_name','Note that in case of negative values (discount) due to a WooCommerce bug, the fee will be always taxes included.'=>'Należy pamiętać, że w przypadku ujemnych wartości (zniżki) spowodowanych błędem WooCommerce opłata będzie zawsze wliczona w podatki.','Apply extra costs/discount considering the item cart quantity'=>'Zastosuj dodatkowe koszty / zniżkę, biorąc pod uwagę ilość koszyka','Detect <span class="wcuf_pdf_label">PDF</span>'=>'Wykryj <span class="wcuf_pdf_label">PDF</span>','The extra costs will be applied to each detected page.'=>'Dodatkowe koszty zostaną zastosowane do każdej wykrytej strony.','Overcharge uploads limit'=>'Limit przeładowania','In case of PDF detection: this will option will be applied to pages and in case di multiple uploads, extra cost pages limit is considered globally per field and not per each pdf.'=>'W przypadku wykrycia pliku PDF: ta opcja zostanie zastosowana do stron, aw przypadku wielokrotnego przesyłania, dodatkowy limit kosztów stron jest rozpatrywany globalnie dla każdego pola, a nie dla każdego pliku pdf.','Free items'=>'Darmowe przedmioty','Leave 0 for no free items. This option works only if the <strong>Multiple files upload per single field</strong> option has been enabled. For the first N uploads will not be applied any extra cost (where N is the value specified using the following number field). '=>'Pozostaw 0 bez darmowych przedmiotów. Ta opcja działa tylko wtedy, gdy włączona jest opcja <strong>Wiele plików przesyłanych na pojedyncze pole</strong>. W przypadku pierwszego przesłania N nie zostaną zastosowane żadne dodatkowe koszty (gdzie N jest wartością określoną za pomocą następującego pola liczbowego). ','In case of PDF detection: this will be considered as "free pages number" and in case di multiple uploads, free pages are computed globally per field and not per each pdf.'=>'W przypadku wykrycia pliku PDF: będzie to uważane za „bezpłatny numer strony”, aw przypadku wielokrotnego przesyłania bezpłatne strony są obliczane globalnie dla każdego pola, a nie dla każdego pliku pdf.','Fee per second'=>'Opłata za sekundę','These option will apply <strong>only for Video/Audio files</strong>. WCUF will try do detect media file the duration (in seconds) extracting the info from its ID3 data (if any and well encoded). For each detected second the plugin will compute the extra costs according the following options.'=>'Ta opcja będzie obowiązywać <strong>tylko w przypadku plików wideo/audio</strong>. WCUF spróbuje wykryć plik multimedialny czas trwania (w sekundach) wyodrębnienia informacji z danych ID3 (jeśli istnieją i są dobrze zakodowane). Dla każdej wykrytej sekundy wtyczka obliczy dodatkowe koszty zgodnie z następującymi opcjami.','The computed extra cost will be added as Cart fee.'=>'Obliczony dodatkowy koszt zostanie dodany jako opłata za koszyk.','An extra text will be added reporting how much costs a second.'=>'Dodany zostanie dodatkowy tekst informujący o kosztach sekundy.','Cost per second'=>'Koszt za sekundę','This is the cost per each detected second.'=>'Jest to koszt za każdą wykrytą sekundę.','Maximun seconds overcharge limit'=>'Maksymalny limit przeciążenia sekund','Free seconds'=>'Darmowe sekundy','First N seconds can be free, set the desidered values. Leave 0 for no free seconds.'=>'Pierwsze N sekund może być wolne, ustaw pominięte wartości. Pozostaw 0 na wolne sekundy.','Product cart price'=>'Cena koszyka','The computed fee will be used as product cart price'=>'Obliczona opłata zostanie wykorzystana jako cena koszyka produktu','The computed fee will be added to product cart price'=>'Obliczona opłata zostanie dodana do ceny koszyka produktu','DropBox account unlinked'=>'Konto DropBox odłączone','Invalid image path'=>'Nieprawidłowa ścieżka obrazu','Cannot create thumb'=>'Nie można utworzyć kciuka','Variation'=>'Odmiana','To use this you have to disable the standard upload field managment for Product page. Go to the Plugin options page and disable it.'=>'Aby tego użyć, musisz wyłączyć standardowe zarządzanie polem przesyłania dla strony Produkt. Przejdź do strony Opcje wtyczki i wyłącz ją.','To use this you have to disable the standard upload field managment for Cart page. Go to the Plugin options page and disable it.'=>'Aby tego użyć, musisz wyłączyć standardowe zarządzanie polem przesyłania dla strony koszyka. Przejdź do strony Opcje wtyczki i wyłącz ją.','To use this you have to disable the standard upload field managment for Checkout page. Go to the Plugin options page and disable it.'=>'Aby tego użyć, musisz wyłączyć standardowe zarządzanie polem przesyłania dla strony Kasa. Przejdź do strony Opcje wtyczki i wyłącz ją.','You have no orders or you are not logged'=>'Nie masz zamówień lub nie jesteś zalogowany','Free!'=>'Wolny!',' (seconds cost)'=>' (koszt sekund)',' (cost per upload)'=>' (koszt przesłania)','Cost: '=>'Koszt: ','Length: '=>'Długość: ','Download / View file'=>'Pobierz / Wyświetl plik','#'=>'#','Browse'=>'Przeglądaj','Add files'=>'Dodaj pliki','Click to choose the file or drag it here'=>'Kliknij, aby wybrać plik lub przeciągnij go tutaj','Click to choose the files or drag them here'=>'Kliknij, a