le types: '=>'Dozwolone typy plików : ','Input file must be an image'=>'Plik wejściowy musi być obrazem','Following files have been removed: '=>'Usunięto następujące pliki: ','Done! '=>'Gotowy! ','Deleting, pelase wait... '=>'Usuwanie, proszę czekaj... ','An error has occurred.'=>'Wystąpił błąd.','The HTML5 standards are not fully supported in this browser, please upgrade it or use a more moder browser like Google Chrome or FireFox.'=>'Standardy HTML5 nie są w pełni obsługiwane w tej przeglądarce, zaktualizuj ją lub użyj bardziej umiarkowanej przeglądarki, takiej jak Google Chrome lub FireFox.','The sum of file sizes cannot be greater than %s MB!'=>'Suma rozmiarów plików nie może być większa niż %s MB!','The sum of file sizes cannot be minor than %s MB!'=>'Suma rozmiarów plików nie może być mniejsza niż %s MB!','Are sure you want to delete the file?'=>'Na pewno chcesz usunąć plik?','To upload:'=>'Przesyłać:','Please upload all the required files before saving'=>'Przed zapisaniem prześlij wszystkie wymagane pliki','Please upload all required files.'=>'Prześlij wszystkie wymagane pliki.','One (or more) file is not an image or it has wrong sizes/DPI. Sizes/DPI allowed: '=>'Jeden (lub więcej) plik nie jest obrazem lub ma nieprawidłowe rozmiary / DPI. Dozwolone rozmiary / DPI : ','Uploaded images:'=>'Przesłane obrazy :','Feedback: '=>'Informacja zwrotna: ','Uploaded files list:'=>'Lista przesłanych plików :','Warning'=>'Ostrzeżenie','OK'=>'OK','Total: '=>'Razem: ','Current: '=>'Aktualny: ','Cancel'=>'Anuluj','Min size: %s MB'=>'Minimalny rozmiar pliku: %s (MB)','Max size: %s MB'=>'Maksymalny rozmiar pliku: %s (MB)','Min files: '=>'Minimalna liczba plików ','Max files: '=>'Maksymalna liczba plików ','Min width: '=>'Minimalna szerokość: ','Max width: '=>'Maksymalna szerokość: ','Min height: '=>'Minimalna wysokość: ','Max height: '=>'Maksymalna wysokość: ','Min DPI: '=>'Minimalne DPI : ','Max DPI: '=>'Maksymalne DPI: ','Ratio: '=>'Stosunek: ','Min length: '=>'Minimalna długość: ','Max length: '=>'Maksymalna długość: ','Uploads Summary'=>'Suma wysłanych plików','Ships to'=>'Wysyłka do','Order'=>'Zamówienie','ID: '=>'ID: ','Placed on: '=>'Umieszczony na: ','Delivery option: '=>'Opcja dostawy: ','Notes: '=>'Notatki: ','Bills to'=>'Rachunki do','SKU'=>'SKU','Details'=>'Detale','Unit Price'=>'Cena jednostkowa','Net subtotal'=>'Suma częściowa netto','Tax'=>'Tax','Delivery'=>'Dostawa','Subtotal : '=>'Razem : ','Tax: '=>'Tax: ','Order uploads'=>'Zamów przesyłanie','Notes for the customer'=>'Uwagi dla klienta','Download / View file(s)'=>'Pobierz / Wyświetl pliki','To complete the <span style="color:#96588a; font-weight:bold;">%s</span> plugin activation, you must verify your purchase license. Click <a href="%s">here</a> to verify it.'=>'Aby ukończyć aktywację wtyczki <span style="color: # 96588a; font-weight: bold;">%s</span>, musisz zweryfikować licencję na zakup. Kliknij <a href="%s">tutaj</a>, aby to zweryfikować.','Woocommerce Upload Files'=>'Woocommerce Prześlij pliki','Upload field configurator'=>'Prześlij konfigurator pola','WooCommerce Upload Files'=>'WooCommerce Prześlij pliki','WCUF plugin allows your customers to attach files to their orders according to the purchased products.'=>'Wtyczka WCUF pozwala klientom dołączać pliki do zamówień zgodnie z zakupionymi produktami.','Lagudi Domenico'=>'Lagudi Domenico']];
